function createCookie(name,value,days) {
	if (days) {
		var date = new Date();
		date.setTime(date.getTime()+(days*24*60*60*1000));
		var expires = "; expires="+date.toGMTString();
	}
	else var expires = "";
	document.cookie = name+"="+value+expires+"; path=/";
}

function readCookie(name) {
	var nameEQ = name + "=";
	var ca = document.cookie.split(';');
	for(var i=0;i < ca.length;i++) {
		var c = ca[i];
		while (c.charAt(0)==' ') c = c.substring(1,c.length);
		if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length,c.length);
	}
	return null;
}

function eraseCookie(name) {
	createCookie(name,"",-1);
}

function toggleHub(btn)
{
	var num = btn.id.substr(15);
	$('#inst'+num+' .content').slideUp("slow");
	if (readCookie("hide:inst" + num) == null) {
		createCookie("hide:inst"+num,1,2);
		var list = $('#inst' + num + ' .content');
		$(list).slideUp("slow");
		btn.setAttribute("src","/theme/e-learning-portal/pix/t/switch_plus.gif");
		return false;
	}else{
		eraseCookie("hide:inst"+num);
		var list = $('#inst' + num + ' .content');
		$(list).slideDown("slow");
		btn.setAttribute("src","/theme/e-learning-portal/pix/t/switch_minus.gif");
		return false;
	}
}

document.addEventListener('click', function(event) {
    if(event.target.id.substr(0,10) == "togglehide")
	{
		event.stopPropagation();
	    event.preventDefault();
		toggleHub(event.target);
	}else{
//		alert(event.target.id)
	}
}, true);

