function showConsole(message)
{
	var loadingDiv = document.createElement("div");
	loadingDiv.setAttribute("style","position:absolute;top:5px;right:50px;background:#000;color:#EDC103;font-weight:bold;padding:10px;");
	loadingDiv.innerHTML = message;
	loadingDiv.id = "loading_box";
	$(loadingDiv).hide();
	document.body.appendChild(loadingDiv);
	$(loadingDiv).fadeIn(1500);
	return loadingDiv;
}
function hideElement(ele)
{
	$(ele).fadeOut();
}
function sortAssignments(c)
{
	var loadingDiv = showConsole("Sorting Course Assignments...");
	var classElements = document.getElementsByClassName("coursebox");
		var ele = classElements[c];
		var assElements = $(ele).children('.assignment');
		var assElementsCache = $(ele).children('.assignment');
		var assList = getAssignmentDateList(ele);
		var originalList = getAssignmentDateList(ele);
		var originalHtml = Array();
		for (var i = 0; i < assList.hashtable.length; i++) {
			originalHtml[i] = assElements[i].innerHTML;
		}
		var freshList = getAssignmentDateList(ele);
		var sortedDates = assList.hashtable;
		sortedDates = sortedDates.sort(dmyOrdA);
		var sortedList = new Hashtable();
		
		for (var i = 0; i < sortedDates.length; i++) {
			sortedList.put(i, originalList.getKey(sortedDates[i]));
		}
		var done = Array(freshList.hashtable.length);
		for (var n = 0; n < done.length; n++) {
			done[n] = 0;
		}
		for (var i = 0; i < freshList.hashtable.length; i++) {
			var key = freshList.getKey(freshList.get(sortedList.get(i)));
			if ($(assElements[i]).parent().get(0).className != "assignmentItem") {
				assElements[i].innerHTML = originalHtml[key];
			}
		//		assElements[i].innerHTML = assElementsCache[freshList.getKey(freshList.get(sortedList.get(i)))].innerHTML;
		}
		hideElement(loadingDiv);
}
var dateRE = /^(\d{2})[\/\- ](\d{2})[\/\- ](\d{4})/;
function dmyOrdA(a, b){
a = a.replace(dateRE,"$3$2$1");
b = b.replace(dateRE,"$3$2$1");
if (a>b) return 1;
if (a <b) return -1;
return 0; }
function dmyOrdD(a, b){
a = a.replace(dateRE,"$3$2$1");
b = b.replace(dateRE,"$3$2$1");
if (a>b) return -1;
if (a <b) return 1;
return 0; }
function mdyOrdA(a, b){
a = a.replace(dateRE,"$3$1$2");
b = b.replace(dateRE,"$3$1$2");
if (a>b) return 1;
if (a <b) return -1;
return 0; }
function getAssignmentDateList(ele)
{
	var assElements = $(ele).children('.assignment');
	var assList = new Hashtable();
	for(var i = 0; i < assElements.length; i++)
	{
		var rawString = assElements[i].getElementsByClassName("info")[0].innerHTML;
		var split = rawString.split(" ")
		var day = split[3];
		var month = split[4];
		var year = split[5];
		if(day == "")
		{
			var day = split[4];
			var month = split[5];
			var year = split[6];	
		}
		switch(month)
		{
			case 'January':
				month = 1;
				break;
			case 'February':
				month = 2
				break;
			case 'March':
				month = 3;
				break;
				case 'April':
				month = 4;
				break;
				case 'May':
				month = 5;
				break;
				case 'June':
				month = 6;
				break;
				case 'July':
				month = 7;
				break;
				case 'August':
				month = 8;
				break;
				case 'September':
				month = 9;
				break;
				case 'October':
				month = 10;
				break;
				case 'November':
				month = 11;
				break;
				case 'December':
				month = 12;
				break;
				
		}
		if(day.length == 1)
		{
			day = "0"+day;
		}
		
		assList.put(i,month+"/"+day+"/"+year.substr(0,year.length-1));

	}
	return assList;
}

function getRawAssignmentDateList(ele)
{
	var assElements = $(ele).children('.assignment');
	var assList = new Hashtable();
	for(var i = 0; i < assElements.length; i++)
	{
		var rawString = assElements[i].getElementsByClassName("info")[0].innerHTML;
		var splitColon = rawString.split(':');
		var split = splitColon[1].split(' ');
		var day = split[3];
		var month = split[4];
		var year = split[5];
		assList.put(i,day+" "+month+" "+year.substr(0,year.length-1));
	}
	return assList;
}

function Hashtable(){
    this.clear = hashtable_clear;
    this.containsKey = hashtable_containsKey;
    this.containsValue = hashtable_containsValue;
    this.get = hashtable_get;
    this.isEmpty = hashtable_isEmpty;
    this.keys = hashtable_keys;
    this.put = hashtable_put;
    this.remove = hashtable_remove;
    this.size = hashtable_size;
    this.toString = hashtable_toString;
    this.values = hashtable_values;
    this.hashtable = new Array();
	this.getKey = hashtable_getKey;
}

/*=======Private methods for internal use only========*/

function hashtable_clear(){
    this.hashtable = new Array();
}

function hashtable_containsKey(key){
    var exists = false;
    for (var i in this.hashtable) {
        if (i == key && this.hashtable[i] != null) {
            exists = true;
            break;
        }
    }
    return exists;
}
function hashtable_getKey(value){
    var contains = false;
    if (value != null) {
        for (var i in this.hashtable) {
            if (this.hashtable[i] == value) {
				this.hashtable[i] = "";
                return i;
				
            }
        }
    }
    return contains;
}

function hashtable_containsValue(value){
    var contains = false;
    if (value != null) {
        for (var i in this.hashtable) {
            if (this.hashtable[i] == value) {
                contains = true;
                break;
            }
        }
    }
    return contains;
}

function hashtable_get(key){
    return this.hashtable[key];
}

function hashtable_isEmpty(){
    return (parseInt(this.size()) == 0) ? true : false;
}

function hashtable_keys(){
    var keys = new Array();
    for (var i in this.hashtable) {
        if (this.hashtable[i] != null)
            keys.push(i);
    }
    return keys;
}

function hashtable_put(key, value){
    if (key == null || value == null) {
        throw "NullPointerException {" + key + "},{" + value + "}";
    }else{
        this.hashtable[key] = value;
    }
}

function hashtable_remove(key){
    var rtn = this.hashtable[key];
    this.hashtable[key] = null;
    return rtn;
}

function hashtable_size(){
    var size = 0;
    for (var i in this.hashtable) {
        if (this.hashtable[i] != null)
            size ++;
    }
    return size;
}

function hashtable_toString(){
    var result = "";
    for (var i in this.hashtable)
    {     
        if (this.hashtable[i] != null)
            result += "{" + i + "},{" + this.hashtable[i] + "}\n";  
    }
    return result;
}

function hashtable_values(){
    var values = new Array();
    for (var i in this.hashtable) {
        if (this.hashtable[i] != null)
            values.push(this.hashtable[i]);
    }
    return values;
}
